Millennium: Week 6. &quot;Last Stand!&quot; Guest-starring Green Lantern (Hal Jordan). Two of Earth's greatest champions, Superman and Green Lantern, have traveled to the far side of the universe in search of the missing Guardians. What they find is the most powerful Manhunter of all, the Manhunter Highmaster ! Can even the Man of Steel and the greatest Green Lantern of all stand against such an awesome power? Story continues in Millennium (1987) #7.

Thanks goes to DobisP.R. for this release.

